package ccxtpro
import ccxt "github.com/ccxt/ccxt/go/v4"
type Phemex struct {
   *PhemexCore
   Core *PhemexCore
   exchangeTyped *ccxt.Phemex
}

func NewPhemex(userConfig map[string]interface{}) *Phemex {
   p := NewPhemexCore()
   p.Init(userConfig)
   return &Phemex{
       PhemexCore: p,
       Core:  p,
       exchangeTyped: ccxt.NewPhemexFromCore(p.base),
   }
}


